import './header.css';
import React from 'react';
import logo from '../image/logo_without_s.png'

function Header (props){

const signinAlter=(params)=>{
    if(params==="")
        return 
    else if(params==="")
        return <span className='signin' >Home</span>
    else if(params==="Home")
        return <span className='signin' >Log out</span>
}
const search=(params)=>{
    if (params==="Home")
    return(
        <div className='searchContainer'>
            <input type='search' placeholder='Search' className='searchInput'/>
        </div>);
        
}
if(props.pageTitle==="AboutUs")
return(<AboutUs pageholder={props.pageholder}/>);
else if (props.pageTitle==="Home")
return(<Home/>)
}

function AboutUs(props){
    return(
        <header className='mainHeader'>
        <div className='leftContent'>
            <img src={logo} alt='EEHRS log' width='10' height='10' className='logo'/>           
            <span className='CompanyName'>Ethiopia Electronic Health Record System</span>
            <hr className='vertical'/>  
            <span className='pageTitle'>{props.pageTitle}</span>
        </div>
        <div className='rightContent'>
        <span className='signin' onClick={()=>{props.pageholder(1)}}>Sign in</span>
        </div>
        </header>
    )
}
function Home(props){

}

export default Header;
